Я НЕ планирую освещать подробно следующие темы (хотя некоторые моменты могут быть затронуты):
- Типы виз;
- Переезд и поиск квартиры;
- Список достопримечательностей Нью-Йорка;
- Стоимость жизни в Нью-Йорке;
- Налоги, медицина и т. п.

Кроме того жильцы решают, что нужно сделать для дома в первую очередь Например, за пять лет я живу в доме кроме текущих/необходимых затрат сделали следующее: 
- заменили отопительный котёл с возможностью переключение между газом и oil (масло?); 
- заменили все стиралки и сушилки;

- сделали ремонт на лобби и на этажах; заменили ковролин;
- переделали козырёк при входе в дом;
- заменили старые лавочки в нашем мини-парке;
- делают систему видеонаблюдения на всех этажах.
